import "./App.css";

function App() {
  return (
    <div className="flex flex-col gap-14 justify-between items-center text-center w-[800px] h-[480px] p-10 bg-black text-white ">
      {/* header */}
      <div className="flex flex-row justify-between items-center w-full px-[150px]">
        <p className="text-3xl mx-0">IMD O</p>
        <p className="text-3xl mx-0">PCC O</p>
        <p className="text-3xl mx-0">60.4 A</p>
      </div>
      {/* speed */}
      <div className="relative flex flex-col gap-5 border-solid border-2 rounded-full w-60 h-60 justify-center items-center">
        {/* <div className="absolute"> */}
        <p className="absolute left-10">0</p>
        <p className="absolute left-0">20</p>
        <p className="absolute left-0">40</p>
        <p className="absolute left-0">60</p>
        <p className="absolute left-0">80</p>
        {/* </div> */}
        <div className="absolute flex flex-row items-end">
          <p className="text-6xl font-bold">17</p>
          <p className="text-base -ml-1">mph</p>
        </div>
      </div>
      {/* footer */}
      <div className="flex flex-row justify-between w-full bg-red-50 h-5">
        {/* energy bar */}
        {/* status numbers */}
      </div>
    </div>
  );
}

export default App;
